import React from "react";
import "./Components/navbar.css";
const NavBar = () => {
  const imgStyle = {
    width: "10px",
    height: "10px"
  };
  return (
    <nav class="navbar navbar-light bg-light justify-content-between">
      <a class="navbar-brand">SmartOffice</a>

      <form class="form-inline">
        <button class="btn btn-outline-success my-2 my-sm-0 m-2" type="submit">
          <img src="./Images/notif-icon.png" style={imgStyle} />
        </button>
        <input
          class="form-control mr-sm-2"
          type="search"
          placeholder="Search for a specific item"
          aria-label="Search"
          width="20px"
        />
      </form>
    </nav>
  );
};

export default NavBar;
